import React, { useState, useEffect } from "react";
import { useLocation, useNavigate } from "react-router-dom";

const ResultsPage = () => {
    const location = useLocation();
    const navigate = useNavigate();

    const [results, setResults] = useState([]);
    const [risk_profile, setRisks] = useState("");
    const riskProfile = location.state?.riskProfile || "Unknown Profile";
    const tags = location.state?.tags 
        ? location.state.tags.split(",").map(tag => tag.trim()) 
        : [];


    const [totalScore, setTotalScore] = useState(0);

    useEffect(() => {
            setTotalScore(results.reduce((total, res) => total + res.selected_score, 0));
        }, [results]);

    useEffect(() => {
        fetchData();
      }, []);
      const userId = location.state?.userId;  

      const fetchData = async () => {
        try {

            const response = await fetch("http://127.0.0.1:5000/api/result_summary", {
                method: "POST",
                headers: {
                    "Content-Type": "application/json"
                },
                body: JSON.stringify({
                    user_id: userId,
                })
            });


          const data = await response.json();
          setResults(data["results_data"]);
          setRisks(data["risk_profile"]);
        } catch (error) {
          console.error("Error fetching categories:", error);
        }
      };

    // Assuming user_id is passed in state

    const handleValidation = async (validationStatus) => {
        try {
            const response = await fetch("http://127.0.0.1:5000/api/user_risk_validate", {
                method: "PATCH",
                headers: {
                    "Content-Type": "application/json"
                },
                body: JSON.stringify({
                    user_id: userId,
                    validation: validationStatus
                })
            });

            if (!response.ok) {
                throw new Error("Failed to validate risk profile");
            }

            const result = await response.json();
            console.log("Validation Response:", result);

            alert(`Risk profile ${validationStatus} successfully!`);
            navigate("/adminDashboard");  // Redirect after validation
        } catch (error) {
            console.error("Error validating risk profile:", error);
            alert("Failed to process your request. Please try again.");
        }
    };

    return (
        <div className="results-container">
            <h1>Risk Profile Result</h1>
            <h2>{riskProfile}</h2>
            <p>Tags: {tags.length > 0 ? tags.join(", ") : "No tags available"}</p>




            <div className="action-buttons">
                <button className="accept-btn" onClick={() => handleValidation("Accepted")}>
                    Accept
                </button>
                <button className="reject-btn" onClick={() => handleValidation("Rejected")}>
                    Reject
                </button> 
            </div>
            <br /><br/>
            <table className="results-table">
                        <thead>
                            <tr>

                                <th>Question</th>
                                <th>Answer</th>
                                <th>Score</th>

                            </tr>
                        </thead>
                        <tbody>

                            {results && results.map((res) => (
                                <React.Fragment key={res.id}>
                                    <tr>
                                        <td> {res.question_text} </td>
                                        <td>{res.selected_option_value}</td>
                                        <td> {res.selected_score} </td>

                                    </tr>
                                </React.Fragment>
                            ))}
                            <tr>
                                <td> Total Score </td>
                                <td>  </td>
                                <td> {totalScore} </td>
                            </tr>
                        </tbody>
                    </table>
            <br /><br/>
            <table className="risk-table">
                        <thead>
                            <tr>

                                <th>Risk Profile </th>
                                <th>Description </th>
                                <th>Threshold Score</th>

                            </tr>
                        </thead>
                        <tbody>
                            {risk_profile && risk_profile.map((res) => (
                                <React.Fragment key={risk_profile.id}>
                                    <tr>
                                        <td> {risk_profile.name} </td>
                                        <td>{risk_profile.description}</td>
                                        <td> {risk_profile.score_threshold} </td>

                                    </tr>
                                </React.Fragment>
                            ))}

                        </tbody>
                    </table>
        </div>
    );
};

export default ResultsPage;
